// Expects 7 digit hex value.
// To represent 0x1.ap-5, use
//      to_hexfloat(0x1a00000, -5)
static constexpr float to_hexfloat(float digits, int exponent)
{
    // Using the relation:
    // 0x1.nnnnnnp0 == 0x1nnnnnn * std::pow(2, -24);
    // 0x1.nnnnnnpz == 0x1nnnnnn * std::pow(2, -24) * std::pow(2, z);
    // which assumes
    //    1. The binary representation for the mantissa is equivalent to the
    //       integer representation.
    //    2. Multiplication by 2^n only changes the exponent in the
    //       binary representation.

    // This function is equivalent to:
    // return digits * std::pow(2, exponent) * std::pow(2, -24);

    // We use a constexpr alternative to std::pow.
    // std::pow(2, -24)
    constexpr float offset = 1.0f/(1<<24);

    // std::pow(2, exponent)
    const float exp = exponent < 0 ? 1.0f/(1<<(-exponent)) : (1<<exponent);

    return digits * exp * offset;
}


